import './style.css';
import success from '../assests/Successsuccess.svg'
export default function Confirm() {
  return (
    <div className="ConfirmConatiner">
        <div className='confirmBox'>
            <div><img src={success}/></div>
            <div className='ConfirmText'>Thanks for your order!</div>
            <div className='ConfirmDes'>Yayyy! You successfully made a payment with Hyperswitch. If its a real store, your items would have been on their way.</div>
            <div className='returnLink'><a href='/'>Try hyperswicth Demo again</a></div>
        </div>
    </div>
  )
}
